import './App.css';
import MyBook from './component/mybook';
function App() {
  return (
    <div className="App">
      <Router>
      <header>
      <div className='NavBar'>

            <ul>
                <li>
                   <Link to="/mybook" >Home</Link> 
                </li>

            </ul>

        </div>
        </header>

      <div>
        <Routes>
          <Route path="/"element={<Home/>}/>
          <Route path="/mybook"element={<MyBook/>}/>

        </Routes>
      </div>
        </Router>
    </div>
  );
}

export default App;
